import { useEffect } from "react";

const styles: Record<string, React.CSSProperties> = {
  logo: {
    width: '80px',
    height: 'auto',
    maxHeight: '60px',
    objectFit: 'contain' as const,
    margin: '0 15px'
  },
  container: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    flexWrap: 'wrap',
    padding: '20px 0'
  },
  partnerItem: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    margin: '10px 15px'
  }
};

const partners: { name: string; logo: string }[] = [
  { name: "Teleperformance", logo: "/images.jpeg" },
  { name: "Eclerx", logo: "data:image/jpeg;base64," },
  { name: "TP", logo: "data:image/png;base64," },
  { name: "Protocol", logo: "data:image/jpeg;base64," },
  { name: "HDFC Bank", logo: "/png-transparent-hdfc-bank-logo-indian-bank.png" },
  { name: "Axis Bank", logo: "data:image/jpeg;base64," },
  { name: "AU Small Finance Bank", logo: "data:image/png;base64," },
  { name: "Kotak Mahindra Bank", logo: "data:image/png;base64," },
  { name: "Yes Bank", logo: "data:image/png;base64," }
];

const Partners = () => {
  useEffect(() => {
    const keyframes = `
      @keyframes slide {
        0% { transform: translateX(0); }
        100% { transform: translateX(-50%); }
      }

      .animate-slide {
        animation: slide 20s linear infinite;
      }

      .partner-logo {
        transition: transform 0.3s ease;
      }

      .partner-logo:hover {
        transform: scale(1.1);
      }
    `;
    const style = document.createElement('style');
    style.textContent = keyframes;
    document.head.appendChild(style);
    return () => {
      document.head.removeChild(style);
    };
  }, []);

  return (
    <div className="relative overflow-hidden bg-white py-4">
      <div className="w-full overflow-hidden">
        <h2 className="text-2xl font-bold text-center mb-4">Till date our students placed in following organisations</h2>
        <div className="flex gap-9 animate-slide">
          {[...partners, ...partners].map((partner, idx) => (
            <div key={idx} className="flex-shrink-0 w-48 h-24 flex items-center justify-center">
              <div key={idx} style={styles.partnerItem}>
                <img
                  src={partner.logo}
                  alt={partner.name}
                  style={styles.logo}
                />
                <span style={{ marginTop: '5px', fontSize: '12px' }}>{partner.name}</span>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Partners;
